import React, { useState, useEffect } from 'react';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import { CssBaseline, Box, Container, Typography, Grid, CircularProgress } from '@mui/material';

const theme = createTheme({
  palette: {
    mode: 'dark',
    primary: { main: '#ffffff' },
    background: { default: '#000000', paper: '#121212' },
  },
  typography: { fontFamily: '"Helvetica Neue", Arial, sans-serif' },
});

const portfolioItems = [
  { title: 'Lighting', videoUrl: 'https://www.youtube.com/embed/moAfqFo3f00' },
  { title: 'Assistant Camera and Drone', videoUrl: 'https://www.youtube.com/embed/ULjGbYWbJDU' },
  { title: 'Camera', videoUrl: 'https://www.instagram.com/p/CzMeq4rPI6Z/embed' },
  { title: 'Drone', videoUrl: 'https://www.youtube.com/embed/HeZck91SBIY' },
  { title: 'Drone', videoUrl: 'https://vimeo.com/921814656/686ea8af77?share=copy#t=70.283' },
  { title: 'General Production 1', videoUrl: 'https://www.youtube.com/embed/sc8DXDWRKac' },
  { title: 'General Production 2', videoUrl: 'https://www.youtube.com/embed/hklSInDi5Rc' },
];

export default function App() {
  const [videoLoaded, setVideoLoaded] = useState(false);

  useEffect(() => {
    const timer = setTimeout(() => setVideoLoaded(true), 2000); // Simulate loading time
    return () => clearTimeout(timer);
  }, []);

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <Box sx={{ minHeight: '100vh', display: 'flex', flexDirection: 'column' }}>
        <Box sx={{ height: '100vh', position: 'relative', overflow: 'hidden' }}>
          {!videoLoaded && (
            <Box sx={{ 
              position: 'absolute', 
              top: 0, 
              left: 0, 
              right: 0, 
              bottom: 0, 
              display: 'flex', 
              alignItems: 'center', 
              justifyContent: 'center',
              backgroundColor: 'background.default'
            }}>
              <CircularProgress />
            </Box>
          )}
          <iframe
            src="https://www.youtube.com/embed/moAfqFo3f00?autoplay=1&mute=1&controls=0&loop=1&playlist=moAfqFo3f00"
            title="Hero Video"
            frameBorder="0"
            allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
            allowFullScreen
            style={{
              position: 'absolute',
              top: '-60px',
              left: 0,
              width: '100%',
              height: 'calc(100% + 120px)',
              border: 'none',
              opacity: videoLoaded ? 1 : 0,
              transition: 'opacity 0.5s ease-in-out',
            }}
          />
        </Box>
        <Container maxWidth="lg" sx={{ mt: 4, position: 'relative', zIndex: 1 }}>
          <Typography variant="h4" gutterBottom sx={{ textAlign: 'center', mb: 4, color: 'primary.main' }}>
            Portfolio
          </Typography>
          <Grid container spacing={4}>
            {portfolioItems.map((item, index) => (
              <Grid item xs={12} md={6} key={index}>
                <Box sx={{ mb: 2 }}>
                  <Typography variant="h6" gutterBottom sx={{ color: 'primary.main' }}>
                    {item.title}
                  </Typography>
                  <Box sx={{ position: 'relative', paddingTop: '56.25%', overflow: 'hidden' }}>
                    <iframe
                      src={item.videoUrl}
                      title={item.title}
                      frameBorder="0"
                      allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
                      allowFullScreen
                      style={{
                        position: 'absolute',
                        top: 0,
                        left: 0,
                        width: '100%',
                        height: '100%',
                      }}
                    />
                  </Box>
                </Box>
              </Grid>
            ))}
          </Grid>
        </Container>
      </Box>
    </ThemeProvider>
  );
}
